jssearch.files = {"1":{"u":".\/\/rest-controllers.html","t":"Controllers ","d":"After creating the resource classes and specifying how resource data should be formatted, the next thing\nto do is to create controller actions to expose the resources to end users through RESTful APIs."},"2":{"u":".\/\/start-hello.html","t":"Saying Hello ","d":"This section describes how to create a new \"Hello\" page in your application.\nTo achieve this goal, you will create an action and\na view:"},"3":{"u":".\/\/runtime-logging.html","t":"Logging ","d":"Yii provides a powerful logging framework that is highly customizable and extensible. Using this framework, you\ncan easily log various types of messages, filter them, and gather them at different targets, such as files, databases,\nemails. "},"4":{"u":".\/\/input-validation.html","t":"Validating Input ","d":"As a rule of thumb, you should never trust the data received from end users and should always validate it\nbefore putting it to good use."},"5":{"u":".\/\/app-models-peliculaform.html","t":"Class app\\models\\PeliculaForm","d":""},"6":{"u":".\/\/rest-rate-limiting.html","t":"Rate Limiting ","d":"To prevent abuse, you should consider adding rate limiting to your APIs. For example, you may want to limit the API usage\nof each user to be at most 100 API calls within a period of 10 minutes. If too many requests are received from a user\nwithin the stated period of the time, a response with status code 429 (meaning \"Too Many Requests\") should be returned."},"7":{"u":".\/\/tutorial-i18n.html","t":"Internationalization ","d":"Internationalization (I18N) refers to the process of designing a software application so that it can be adapted to\nvarious languages and regions without engineering changes. For Web applications, this is of particular importance\nbecause the potential users may be worldwide. Yii offers a full spectrum of I18N features that support message\ntranslation, view translation, date and number formatting."},"8":{"u":".\/\/structure-extensions.html","t":"Extensions ","d":"Extensions are redistributable software packages specifically designed to be used in Yii applications and provide\nready-to-use features. For example, the yiisoft\/yii2-debug extension adds a handy debug toolbar\nat the bottom of every page in your application to help you more easily grasp how the pages are generated. You can\nuse extensions to accelerate your development process. You can also package your code as extensions to share with\nother people your great work."},"9":{"u":".\/\/test-environment-setup.html","t":"Testing environment setup ","d":"Note: This section is under development."},"10":{"u":".\/\/app-models-peliculasearch.html","t":"Class app\\models\\PeliculaSearch","d":"PeliculaSearch represents the model behind the search form about app\\models\\Pelicula."},"11":{"u":".\/\/concept-autoloading.html","t":"Class Autoloading ","d":"Yii relies on the class autoloading mechanism\nto locate and include all required class files. It provides a high-performance class autoloader that is compliant with the\nPSR-4 standard.\nThe autoloader is installed when you include the Yii.php file."},"12":{"u":".\/\/output-data-providers.html","t":"Data Providers ","d":"In the Pagination and Sorting sections, we have described how to\nallow end users to choose a particular page of data to display and sort them by some columns. Because the task\nof paginating and sorting data is very common, Yii provides a set of data provider classes to encapsulate it."},"13":{"u":".\/\/runtime-requests.html","t":"Requests ","d":"Requests made to an application are represented in terms of yii\\web\\Request objects which provide information\nsuch as request parameters, HTTP headers, cookies, etc. For a given request, you can get access to the corresponding\nrequest object via the request application component which is an instance\nof yii\\web\\Request, by default. In this section, we will describe how you can make use of this component in your applications."},"14":{"u":".\/\/test-acceptance.html","t":"Acceptance Tests ","d":"Note: This section is under development."},"15":{"u":".\/\/test-fixtures.html","t":"Fixtures ","d":"Fixtures are an important part of testing. Their main purpose is to set up the environment in a fixed\/known state\nso that your tests are repeatable and run in an expected way. Yii provides a fixture framework that allows\nyou to define your fixtures precisely and use them easily."},"16":{"u":".\/\/start-databases.html","t":"Working with Databases ","d":"This section will describe how to create a new page that displays country data fetched from\na database table named country. To achieve this goal, you will configure a database connection,\ncreate an Active Record class, define an action,\nand create a view."},"17":{"u":".\/\/structure-entry-scripts.html","t":"Entry Scripts ","d":"Entry scripts are the first step in the application bootstrapping process. An application (either\nWeb application or console application) has a single entry script. End users make requests to\nentry scripts which instantiate application instances and forward the requests to them."},"18":{"u":".\/\/app-models-contactform.html","t":"Class app\\models\\ContactForm","d":"ContactForm is the model behind the contact form."},"19":{"u":".\/\/runtime-handling-errors.html","t":"Handling Errors ","d":"Yii includes a built-in yii\\web\\ErrorHandler which makes error handling a much more pleasant\nexperience than before. In particular, the Yii error handler does the following to improve error handling:"},"20":{"u":".\/\/security-cryptography.html","t":"Cryptography ","d":"In this section we'll review the following security aspects:"},"21":{"u":".\/\/intro-yii.html","t":"What is Yii ","d":"Yii is a high performance, component-based PHP framework for rapidly developing modern Web applications.\nThe name Yii (pronounced Yee or [ji:]) means \"simple and evolutionary\" in Chinese. It can also\nbe thought of as an acronym for Yes It Is!"},"22":{"u":".\/\/output-formatting.html","t":"Data Formatting ","d":"To display data in a more readable format for users, you may format them using the formatter application component.\nBy default the formatter is implemented by yii\\i18n\\Formatter which provides a set of methods to format data as \ndate\/time, numbers, currencies, and other commonly used formats. You can use the formatter like the following,"},"23":{"u":".\/\/rest-routing.html","t":"Routing ","d":"With resource and controller classes ready, you can access the resources using the URL like\nhttp:\/\/localhost\/index.php?r=user\/create, similar to what you can do with normal Web applications."},"24":{"u":".\/\/app-models-pelicula.html","t":"Class app\\models\\Pelicula","d":"This is the model class for table \"peliculas\"."},"25":{"u":".\/\/app-assets-appasset.html","t":"Class app\\assets\\AppAsset","d":""},"26":{"u":".\/\/start-installation.html","t":"Installing Yii ","d":"You can install Yii in two ways, using the Composer package manager or by downloading an archive file.\nThe former is the preferred way, as it allows you to install new extensions or update Yii by simply running a single command."},"27":{"u":".\/\/app-controllers-peliculascontroller.html","t":"Class app\\controllers\\PeliculasController","d":"PeliculasController implements the CRUD actions for Pelicula model."},"28":{"u":".\/\/output-client-scripts.html","t":"Working with Client Scripts ","d":"Modern web applications, additionally to static HTML pages that are\nrendered and sent to the browser, contain JavaScript that is used\nto modify the page in the browser by manipulating existing elements or\nloading new content via AJAX.\nThis section describes methods provided by Yii for adding JavaScript and CSS to a website as well as dynamically adjusting these."},"29":{"u":".\/\/runtime-responses.html","t":"Responses ","d":"When an application finishes handling a request, it generates a yii\\web\\Response object\nand sends it to the end user. The response object contains information such as the HTTP status code, HTTP headers and body.\nThe ultimate goal of Web application development is essentially to build such response objects upon various requests."},"30":{"u":".\/\/test-functional.html","t":"Functional Tests ","d":"Note: This section is under development."},"31":{"u":".\/\/db-dao.html","t":"Database Access Objects ","d":"Built on top of PDO, Yii DAO (Database Access Objects) provides an\nobject-oriented API for accessing relational databases. It is the foundation for other more advanced database\naccess methods, including query builder and active record."},"32":{"u":".\/\/structure-controllers.html","t":"Controllers ","d":"Controllers are part of the MVC architecture.\nThey are objects of classes extending from yii\\base\\Controller and are responsible for processing requests and\ngenerating responses. In particular, after taking over the control from applications,\ncontrollers will analyze incoming request data, pass them to models, inject model results\ninto views, and finally generate outgoing responses."},"33":{"u":".\/\/runtime-sessions-cookies.html","t":"Sessions and Cookies ","d":"Sessions and cookies allow data to be persisted across multiple user requests. In plain PHP you may access them\nthrough the global variables $_SESSION and $_COOKIE, respectively. Yii encapsulates sessions and cookies as objects\nand thus allows you to access them in an object-oriented fashion with additional useful enhancements."},"34":{"u":".\/\/structure-widgets.html","t":"Widgets ","d":"Widgets are reusable building blocks used in views to create complex and configurable user\ninterface elements in an object-oriented fashion. For example, a date picker widget may generate a fancy date picker\nthat allows users to pick a date as their input. All you need to do is just to insert the code in a view\nlike the following:"},"35":{"u":".\/\/security-overview.html","t":"Security ","d":"Good security is vital to the health and success of any application. Unfortunately, many developers cut corners when it\ncomes to security, either due to a lack of understanding or because implementation is too much of a hurdle. To make your\nYii powered application as secure as possible, Yii has included several excellent and easy to use security features."},"36":{"u":".\/\/tutorial-shared-hosting.html","t":"Shared Hosting Environment ","d":"Shared hosting environments are often quite limited about configuration and directory structure. Still in most cases you\ncan run Yii 2.0 on a shared hosting environment with a few adjustments."},"37":{"u":".\/\/tutorial-template-engines.html","t":"Using template engines ","d":"By default, Yii uses PHP as its template language, but you can configure Yii to support other rendering engines, such as\nTwig or Smarty available as extensions."},"38":{"u":".\/\/structure-modules.html","t":"Modules ","d":"Modules are self-contained software units that consist of models, views,\ncontrollers, and other supporting components. End users can access the controllers\nof a module when it is installed in application. For these reasons, modules are\noften viewed as mini-applications. Modules differ from applications in that\nmodules cannot be deployed alone and must reside within applications."},"39":{"u":".\/\/app-models-gestionarform.html","t":"Class app\\models\\GestionarForm","d":""},"40":{"u":".\/\/security-passwords.html","t":"Working with Passwords ","d":"Most developers know that passwords cannot be stored in plain text, but many developers believe it's still safe to hash\npasswords using md5 or sha1. There was a time when using the aforementioned hashing algorithms was sufficient,\nbut modern hardware makes it possible to reverse such hashes and even stronger ones very quickly using brute force attacks."},"41":{"u":".\/\/concept-components.html","t":"Components ","d":"Components are the main building blocks of Yii applications. Components are instances of yii\\base\\Component,\nor an extended class. The three main features that components provide to other classes are:"},"42":{"u":".\/\/input-multiple-models.html","t":"Getting Data for Multiple Models ","d":"When dealing with some complex data, it is possible that you may need to use multiple different models to collect\nthe user input. For example, assuming the user login information is stored in the user table while the user profile\ninformation is stored in the profile table, you may want to collect the input data about a user through a User model \nand a Profile model. With the Yii model and form support, you can solve this problem in a way that is not much\ndifferent from handling a single model."},"43":{"u":".\/\/structure-application-components.html","t":"Application Components ","d":"Applications are service locators. They host a set of the so-called\napplication components that provide different services for processing requests. For example,\nthe urlManager component is responsible for routing Web requests to appropriate controllers;\nthe db component provides DB-related services; and so on."},"44":{"u":".\/\/input-forms.html","t":"Creating Forms ","d":"The primary way of using forms in Yii is through yii\\widgets\\ActiveForm. This approach should be preferred when\nthe form is based upon a model. Additionally, there are some useful methods in yii\\helpers\\Html that are typically\nused for adding buttons and help text to any form."},"45":{"u":".\/\/helper-url.html","t":"Url Helper ","d":"Url helper provides a set of static methods for managing URLs."},"46":{"u":".\/\/helper-html.html","t":"Html helper ","d":"Every web application generates lots of HTML markup. If the markup is static, it can be done efficiently by\nmixing PHP and HTML in a single file, but when it is\ngenerated dynamically it starts to get tricky to handle it without extra help. Yii provides such help in the form\nof an Html helper, which provides a set of static methods for handling commonly used HTML tags, their options, and their content."},"47":{"u":".\/\/app-models-totalform.html","t":"Class app\\models\\TotalForm","d":""},"48":{"u":".\/\/caching-http.html","t":"HTTP Caching ","d":"Besides server-side caching that we have described in the previous sections, Web applications may\nalso exploit client-side caching to save the time for generating and transmitting the same page content."},"49":{"u":".\/\/tutorial-performance-tuning.html","t":"Performance Tuning ","d":"There are many factors affecting the performance of your Web application. Some are environmental, some are related \nwith your code, while some others are related with Yii itself. In this section, we will enumerate most of these\nfactors and explain how you can improve your application performance by adjusting these factors."},"50":{"u":".\/\/output-data-widgets.html","t":"Data widgets ","d":"Yii provides a set of widgets that can be used to display data.\nWhile the DetailView widget can be used to display data for a single record,\nListView and GridView can be used to display a list or table of data records\nproviding features like pagination, sorting and filtering."},"51":{"u":".\/\/start-workflow.html","t":"Running Applications ","d":"After installing Yii, you have a working Yii application that can be accessed via\nthe URL http:\/\/hostname\/basic\/web\/index.php or http:\/\/hostname\/index.php, depending\nupon your configuration. This section will introduce the application's built-in functionality,\nhow the code is organized, and how the application handles requests in general."},"52":{"u":".\/\/input-tabular-input.html","t":"Collecting tabular input ","d":"Sometimes you need to handle multiple models of the same kind in a single form. For example, multiple settings, where\neach setting is stored as a name-value pair and is represented by a Setting active record model.\nThis kind of form is also often referred to as \"tabular input\".\nIn contrast to this, handling different models of different kind, is handled in the section\nComplex Forms with Multiple Models."},"53":{"u":".\/\/structure-models.html","t":"Models ","d":"Models are part of the MVC architecture.\nThey are objects representing business data, rules and logic."},"54":{"u":".\/\/app-models-alquilersearch.html","t":"Class app\\models\\AlquilerSearch","d":"AlquilerSearch represents the model behind the search form about app\\models\\Alquiler."},"55":{"u":".\/\/structure-overview.html","t":"Overview ","d":"Yii applications are organized according to the model-view-controller (MVC)\narchitectural pattern. Models represent data, business logic and rules; views\nare output representation of models; and controllers take input and convert\nit to commands for models and views."},"56":{"u":".\/\/tutorial-start-from-scratch.html","t":"Creating your own Application structure ","d":"Note: This section is under development."},"57":{"u":".\/\/rest-resources.html","t":"Resources ","d":"RESTful APIs are all about accessing and manipulating resources. You may view resources as\nmodels in the MVC paradigm."},"58":{"u":".\/\/README.html","t":"The Definitive Guide to Yii 2.0 ","d":"This tutorial is released under the Terms of Yii Documentation."},"59":{"u":".\/\/app-models-alquiler.html","t":"Class app\\models\\Alquiler","d":"This is the model class for table \"alquileres\"."},"60":{"u":".\/\/runtime-bootstrapping.html","t":"Bootstrapping ","d":"Bootstrapping refers to the process of preparing the environment before an application starts\nto resolve and process an incoming request. Bootstrapping is done in two places:\nthe entry script and the application."},"61":{"u":".\/\/app-controllers-alquilerescontroller.html","t":"Class app\\controllers\\AlquileresController","d":""},"62":{"u":".\/\/db-migrations.html","t":"Database Migration ","d":"During the course of developing and maintaining a database-driven application, the structure of the database\nbeing used evolves just like the source code does. For example, during the development of an application,\na new table may be found necessary; after the application is deployed to production, it may be discovered\nthat an index should be created to improve the query performance; and so on. Because a database structure change\noften requires some source code changes, Yii supports the so-called database migration feature that allows\nyou to keep track of database changes in terms of database migrations which are version-controlled together\nwith the source code."},"63":{"u":".\/\/concept-behaviors.html","t":"Behaviors ","d":"Behaviors are instances of yii\\base\\Behavior, or of a child class. Behaviors, also known\nas mixins, allow you to enhance the functionality\nof an existing yii\\base\\Component class without needing to change the class's inheritance.\nAttaching a behavior to a component \"injects\" the behavior's methods and properties into the component, making those methods and properties accessible as if they were defined in the component class itself. Moreover, a behavior\ncan respond to the events triggered by the component, which allows behaviors to also customize the normal\ncode execution of the component."},"64":{"u":".\/\/test-overview.html","t":"Testing ","d":"Testing is an important part of software development. Whether we are aware of it or not, we conduct testing continuously.\nFor example, when we write a class in PHP, we may debug it step by step or simply use echo or die statements to verify\nthe implementation works according to our initial plan. In the case of a web application, we're entering some test data\nin forms to ensure the page interacts with us as expected."},"65":{"u":".\/\/runtime-routing.html","t":"Routing and URL Creation ","d":"When a Yii application starts processing a requested URL, the first step it takes is to parse the URL\ninto a route. The route is then used to instantiate the corresponding\ncontroller action to handle the request. This whole process is called routing."},"66":{"u":".\/\/start-looking-ahead.html","t":"Looking Ahead ","d":"If you've read through the entire \"Getting Started\" chapter, you have now created a complete Yii application. In the process, you have learned how to implement some commonly\nneeded features, such as getting data from users via an HTML form, fetching data from a database, and\ndisplaying data in a paginated fashion. You have also learned how to use Gii to generate\ncode automatically. Using Gii for code generation turns the bulk of your Web development process into a task as simple as just filling out some forms. "},"67":{"u":".\/\/tutorial-console.html","t":"Console applications ","d":"Besides the rich features for building web applications, Yii also has full-featured support for console applications\nwhich are mainly used to create background and maintenance tasks that need to be performed for a website."},"68":{"u":".\/\/runtime-overview.html","t":"Overview ","d":"Each time when a Yii application handles a request, it undergoes a similar workflow."},"69":{"u":".\/\/structure-applications.html","t":"Applications ","d":"Applications are objects that govern the overall structure and lifecycle of Yii application systems.\nEach Yii application system contains a single application object which is created in\nthe entry script and is globally accessible through the expression \\Yii::$app."},"70":{"u":".\/\/index.html","t":"Class Reference","d":""},"71":{"u":".\/\/security-authentication.html","t":"Authentication ","d":"Authentication is the process of verifying the identity of a user. It usually uses an identifier\n(e.g. a username or an email address) and a secret token (e.g. a password or an access token) to judge\nif the user is the one whom he claims as. Authentication is the basis of the login feature."},"72":{"u":".\/\/concept-aliases.html","t":"Aliases ","d":"Aliases are used to represent file paths or URLs so that you don't have to hard-code absolute paths or URLs in your\nproject. An alias must start with the @ character to be differentiated from normal file paths and URLs. Alias defined\nwithout leading @ will be prefixed with @ character."},"73":{"u":".\/\/test-unit.html","t":"Unit Tests ","d":"Note: This section is under development."},"74":{"u":".\/\/app-controllers-sitecontroller.html","t":"Class app\\controllers\\SiteController","d":""},"75":{"u":".\/\/app-controllers-socioscontroller.html","t":"Class app\\controllers\\SociosController","d":"SociosController implements the CRUD actions for Socio model."},"76":{"u":".\/\/rest-error-handling.html","t":"Error Handling ","d":"When handling a RESTful API request, if there is an error in the user request or if something unexpected\nhappens on the server, you may simply throw an exception to notify the user that something went wrong.\nIf you can identify the cause of the error (e.g., the requested resource does not exist), you should\nconsider throwing an exception along with a proper HTTP status code (e.g., yii\\web\\NotFoundHttpException\nrepresents a 404 status code). Yii will send the response along with the corresponding HTTP status\ncode and text. Yii will also include the serialized representation of the\nexception in the response body. For example:"},"77":{"u":".\/\/intro-upgrade-from-v1.html","t":"Upgrading from Version 1.1 ","d":"There are many differences between versions 1.1 and 2.0 of Yii as the framework was completely rewritten for 2.0.\nAs a result, upgrading from version 1.1 is not as trivial as upgrading between minor versions. In this guide you'll\nfind the major differences between the two versions."},"78":{"u":".\/\/concept-service-locator.html","t":"Service Locator ","d":"A service locator is an object that knows how to provide all sorts of services (or components) that an application\nmight need. Within a service locator, each component exists as only a single instance, uniquely identified by an ID.\nYou use the ID to retrieve a component from the service locator."},"79":{"u":".\/\/rest-quick-start.html","t":"Quick Start ","d":"Yii provides a whole set of tools to simplify the task of implementing RESTful Web Service APIs.\nIn particular, Yii supports the following features about RESTful APIs:"},"80":{"u":".\/\/app-models-user.html","t":"Class app\\models\\User","d":""},"81":{"u":".\/\/output-pagination.html","t":"Pagination ","d":"When there are too much data to be displayed on a single page, a common strategy is to display them in multiple\npages and on each page only display a small portion of the data. This strategy is known as pagination."},"82":{"u":".\/\/caching-overview.html","t":"Caching ","d":"Caching is a cheap and effective way to improve the performance of a Web application. By storing relatively\nstatic data in cache and serving it from cache when requested, the application saves the time that would be\nrequired to generate the data from scratch every time."},"83":{"u":".\/\/structure-assets.html","t":"Assets ","d":"An asset in Yii is a file that may be referenced in a Web page. It can be a CSS file, a JavaScript file, an image\nor video file, etc. Assets are located in Web-accessible directories and are directly served by Web servers."},"84":{"u":".\/\/security-best-practices.html","t":"Security best practices ","d":"Below we'll review common security principles and describe how to avoid threats when developing applications using Yii."},"85":{"u":".\/\/input-file-upload.html","t":"Uploading Files ","d":"Uploading files in Yii is usually done with the help of yii\\web\\UploadedFile which encapsulates each uploaded\nfile as an UploadedFile object. Combined with yii\\widgets\\ActiveForm and models,\nyou can easily implement a secure file uploading mechanism."},"86":{"u":".\/\/tutorial-yii-integration.html","t":"Working with Third-Party Code ","d":"From time to time, you may need to use some third-party code in your Yii applications. Or you may want to\nuse Yii as a library in some third-party systems. In this section, we will show how to achieve these goals."},"87":{"u":".\/\/caching-data.html","t":"Data Caching ","d":"Data caching is about storing some PHP variables in cache and retrieving it later from cache.\nIt is also the foundation for more advanced caching features, such as query caching\nand page caching."},"88":{"u":".\/\/output-theming.html","t":"Theming ","d":"Theming is a way to replace a set of views with another without the need of touching\nthe original view rendering code. You can use theming to systematically change the look and feel of an application."},"89":{"u":".\/\/concept-events.html","t":"Events ","d":"Events allow you to inject custom code into existing code at certain execution points. You can attach custom\ncode to an event so that when the event is triggered, the code gets executed automatically. For example,\na mailer object may trigger a messageSent event when it successfully sends a message. If you want to keep\ntrack of the messages that are successfully sent, you could then simply attach the tracking code to the messageSent event."},"90":{"u":".\/\/app-models-loginform.html","t":"Class app\\models\\LoginForm","d":"LoginForm is the model behind the login form."},"91":{"u":".\/\/helper-overview.html","t":"Helpers ","d":"Note: This section is under development."},"92":{"u":".\/\/rest-versioning.html","t":"Versioning ","d":"A good API is versioned: changes and new features are implemented in new versions of the API instead of continually altering just one version. Unlike Web applications, with which you have full control of both the client-side and server-side\ncode, APIs are meant to be used by clients beyond your control. For this reason, backward\ncompatibility (BC) of the APIs should be maintained whenever possible. If a change that may break BC is necessary, you should introduce it in new version of the API, and bump up the version number. Existing clients can continue to use the old, working version of the API; and new or upgraded clients can get the new functionality in the new API version. "},"93":{"u":".\/\/app-models-alquilerform.html","t":"Class app\\models\\AlquilerForm","d":""},"94":{"u":".\/\/rest-response-formatting.html","t":"Response Formatting ","d":"When handling a RESTful API request, an application usually takes the following steps that are related\nwith response formatting:"},"95":{"u":".\/\/tutorial-core-validators.html","t":"Core Validators ","d":"Yii provides a set of commonly used core validators, found primarily under the yii\\validators namespace.\nInstead of using lengthy validator class names, you may use aliases to specify the use of these core\nvalidators. For example, you can use the alias required to refer to the yii\\validators\\RequiredValidator class:"},"96":{"u":".\/\/db-active-record.html","t":"Active Record ","d":"Active Record provides an object-oriented interface\nfor accessing and manipulating data stored in databases. An Active Record class is associated with a database table,\nan Active Record instance corresponds to a row of that table, and an attribute of an Active Record\ninstance represents the value of a particular column in that row. Instead of writing raw SQL statements,\nyou would access Active Record attributes and call Active Record methods to access and manipulate the data stored \nin database tables."},"97":{"u":".\/\/app-models-sociosearch.html","t":"Class app\\models\\SocioSearch","d":"SocioSearch represents the model behind the search form about app\\models\\Socio."},"98":{"u":".\/\/app-commands-hellocontroller.html","t":"Class app\\commands\\HelloController","d":"This command echoes the first argument that you have entered."},"99":{"u":".\/\/concept-configurations.html","t":"Configurations ","d":"Configurations are widely used in Yii when creating new objects or initializing existing objects.\nConfigurations usually include the class name of the object being created, and a list of initial values\nthat should be assigned to the object's properties. Configurations may also include a list of\nhandlers that should be attached to the object's events and\/or a list of\nbehaviors that should also be attached to the object."},"100":{"u":".\/\/rest-authentication.html","t":"Authentication ","d":"Unlike Web applications, RESTful APIs are usually stateless, which means sessions or cookies should not\nbe used. Therefore, each request should come with some sort of authentication credentials because\nthe user authentication status may not be maintained by sessions or cookies. A common practice is\nto send a secret access token with each request to authenticate the user. Since an access token\ncan be used to uniquely identify and authenticate a user, API requests should always be sent\nvia HTTPS to prevent man-in-the-middle (MitM) attacks."},"101":{"u":".\/\/app-models-devolverform.html","t":"Class app\\models\\DevolverForm","d":""},"102":{"u":".\/\/helper-array.html","t":"ArrayHelper ","d":"Additionally to the rich set of PHP array functions, the Yii array helper provides\nextra static methods allowing you to deal with arrays more efficiently."},"103":{"u":".\/\/app-models-socio.html","t":"Class app\\models\\Socio","d":"This is the model class for table \"socios\"."},"104":{"u":".\/\/security-authorization.html","t":"Authorization ","d":"Authorization is the process of verifying that a user has enough permission to do something. Yii provides two authorization\nmethods: Access Control Filter (ACF) and Role-Based Access Control (RBAC)."},"105":{"u":".\/\/tutorial-mailing.html","t":"Mailing ","d":"Note: This section is under development."},"106":{"u":".\/\/start-forms.html","t":"Working with Forms ","d":"This section describes how to create a new page with a form for getting data from users.\nThe page will display a form with a name input field and an email input field.\nAfter getting those two pieces of information from the user, the page will echo the entered values back for confirmation."},"107":{"u":".\/\/caching-page.html","t":"Page Caching ","d":"Page caching refers to caching the content of a whole page on the server-side. Later when the same page\nis requested again, its content will be served from the cache instead of regenerating it from scratch."},"108":{"u":".\/\/start-gii.html","t":"Generating Code with Gii ","d":"This section will describe how to use Gii to automatically generate code\nthat implements some common Web site features. Using Gii to auto-generate code is simply a matter of entering the right information per the instructions shown on the Gii Web pages."},"109":{"u":".\/\/concept-di-container.html","t":"Dependency Injection Container ","d":"A dependency injection (DI) container is an object that knows how to instantiate and configure objects and\nall their dependent objects. Martin Fowler's article has well\nexplained why DI container is useful. Here we will mainly explain the usage of the DI container provided by Yii."},"110":{"u":".\/\/structure-views.html","t":"Views ","d":"Views are part of the MVC architecture.\nThey are code responsible for presenting data to end users. In a Web application, views are usually created\nin terms of view templates which are PHP script files containing mainly HTML code and presentational PHP code.\nThey are managed by the yii\\web\\View application component which provides commonly used methods\nto facilitate view composition and rendering. For simplicity, we often call view templates or view template files\nas views."},"111":{"u":".\/\/output-sorting.html","t":"Sorting ","d":"When displaying multiple rows of data, it is often needed that the data be sorted according to some columns\nspecified by end users. Yii uses a yii\\data\\Sort object to represent the information about a sorting schema.\nIn particular, "},"112":{"u":".\/\/glossary.html","t":"A ","d":"Alias is a string that's used by Yii to refer to the class or directory such as @app\/vendor."},"113":{"u":".\/\/db-query-builder.html","t":"Query Builder ","d":"Built on top of Database Access Objects, query builder allows you to construct a SQL query\nin a programmatic and DBMS-agnostic way. Compared to writing raw SQL statements, using query builder will help you write \nmore readable SQL-related code and generate more secure SQL statements.  "},"114":{"u":".\/\/caching-fragment.html","t":"Fragment Caching ","d":"Fragment caching refers to caching a fragment of a Web page. For example, if a page displays a summary of\nyearly sale in a table, you can store this table in cache to eliminate the time needed to generate this table\nfor each request. Fragment caching is built on top of data caching."},"115":{"u":".\/\/structure-filters.html","t":"Filters ","d":"Filters are objects that run before and\/or after controller actions. For example,\nan access control filter may run before actions to ensure that they are allowed to be accessed by particular end users;\na content compression filter may run after actions to compress the response content before sending them out to end users."},"116":{"u":".\/\/concept-properties.html","t":"Properties ","d":"In PHP, class member variables are also called properties. These variables are part of the class definition, and are used\nto represent the state of a class instance (i.e., to differentiate one instance of the class from another).\nIn practice, you may often want to handle the reading or writing of properties in special ways. For example,\nyou may want to always trim a string when it is being assigned\nto a label property. You could use the following code to achieve this task:"}};
jssearch.tokenizeString = function(string) {
		var stopWords = ["a","an","and","are","as","at","be","but","by","for","if","in","into","is","it","no","not","of","on","or","such","that","the","their","then","there","these","they","this","to","was","will","with","yii"];
		return string.split(/[\s\.,;\:\\\/\[\]\(\)\{\}]+/).map(function(val) {
			return val.toLowerCase();
		}).filter(function(val) {
			for (w in stopWords) {
				if (stopWords[w] == val) return false;
			}
			return true;
		}).map(function(word) {
			return {t: word, w: 1};
		});
};